import React from 'react';

function CategoryList({ categories, onSelectCategory }) {
  return (
    <div>
      <h4>대학교 공부정리(B/1-1)</h4>
      {categories.map((category, index) => (
        <div key={index}>
          <h3>{category.name}</h3>
          {category.posts.map((opt, optIndex) => (
            <div
              key={optIndex}
              onClick={() => onSelectCategory(category.name, opt.name, opt.type)}
              style={{ cursor: 'pointer', color: 'blue' }}
            >
              {opt.name}
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}

export default CategoryList;
